    value: The Kentucky Democratic Party is in receipt of your letter of October 6
      2004 regarding the committee's 2004 September Monthly report.  The totals for
      lines 6(c) 7 8 11a(iii) 11(d) 19 20 21(a)(i) 21(a)(ii) 21(c) 31 32 Column B
      of the Summary and Detailed Summary Page(s) have been recalculated and are now
      correct.  -  The FEC indicated that Schedule A Supporting Line 17 disclosed
      payments from orginizations which are not registered committees with the commissiom.  None
      of the committees indicated by the commission were disclosed on Schedule A Supporting
      Line 17; however they were disclosed on Schedule A Supporting Line 15.  These
      payments were offsets for goods such as yard signs bumper stickers and pins
